package com.yaowang.lansha.service.impl;import java.util.List;import java.util.Map;import javax.annotation.Resource;import com.yaowang.common.dao.PageDto;import com.yaowang.lansha.dao.ActivityUserLogDao;import com.yaowang.lansha.entity.ActivityUserLog;import com.yaowang.lansha.service.ActivityUserLogService;import org.springframework.stereotype.Service;/** * 抽奖机会抽取日志  * @author  *  */@Service("activityUserLogService")public class ActivityUserLogServiceImpl implements ActivityUserLogService{	@Resource	private ActivityUserLogDao activityUserLogDao;		@Override	public ActivityUserLog save(ActivityUserLog entity){		return activityUserLogDao.save(entity);	}		@Override	public Integer delete(String[] ids){		return activityUserLogDao.delete(ids);	}		@Override	public Integer update(ActivityUserLog entity){		return activityUserLogDao.update(entity);	}		@Override	public ActivityUserLog getActivityUserLogById(String id){		return activityUserLogDao.getActivityUserLogById(id);	}		@Override	public Map<String, ActivityUserLog> getActivityUserLogMapByIds(String[] ids){		return activityUserLogDao.getActivityUserLogMapByIds(ids);	}		@Override	public List<ActivityUserLog> getActivityUserLogList(ActivityUserLog entity){		return activityUserLogDao.getActivityUserLogList(entity);	}		@Override	public List<ActivityUserLog> getActivityUserLogPage(ActivityUserLog entity, PageDto page){		return activityUserLogDao.getActivityUserLogPage(entity, page);	}	}